import moment from 'moment'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Card from 'react-bootstrap/Card'
import Table from 'react-bootstrap/Table'

import NavbarRadnik from '../NavbarRadnik'
import axios from 'axios';



const today = moment().format('YYYY-MM-DD')
class RadnikPregledRez extends Component {
  constructor(props) {
    super(props);

    const rezervacija = [];

    for (let i = 0; i < 10; i++) {
        rezervacija.push({
            in: "2021-03-04",
            out: "2021-03-10",
            soba: "Superior",
            ime: "Emina Zahirovic"

        });
    }

    this.state = { rezervacija };
}
    /*         
  state = {
    selectedDate: today,
    nights: '',
    noOfRooms: '',
    roomType: '',
    occupied: '',
    availableRooms: [],
    roomTypes: [],
    availableChecked: true,
    occupiedChecked: false
  }*/

  render () {
    return (
      <>
      <NavbarRadnik/>
      <div className="maincontainer">
      <div>
    {this.state.rezervacija.map((person, index) => (
        <p>Hello, {person.ime} from {person.in}!</p>
    ))}
    
    </div>
       
        <h1 className="mr-5 ml-5 mt-5">Therichpost.com</h1>
        
     
      </div>
        
      </>
    );
  }
}

export default RadnikPregledRez
